scriptlet.script:
try {
	if(document.trim().length == 0) {
		throw new Error("Empty response on IDM Token Request");
	}
	var d = JSON.parse(document);
	scriptletResult = d.token.id;
	scriptletResponse="success";
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse="failure";
}
